import React, { Component } from "react";
import Logo from "../../../assets/logo.svg";

import { Container, Form, Label, TextTerms } from "./styles";
import Input from "../../../components/Input";

export default class CreateFisicalPerson extends Component {
  state = {
    user: {
      name: ""
    }
  };

  render() {
    return (
      <Container>
        <Form>
          <img src={Logo} alt="Osc-logo" />
          <Label>
            <p>Nome:</p>
            <Input
              type="text"
              onChange={this.handleChange}
              value={this.state.name}
              placeholder="Nome"
            />
          </Label>

          <Label>
            <p>Sobrenome:</p>
            <Input
              type="text"
              onChange={this.handleChange}
              value={this.state.name}
              placeholder="Sobrenome"
            />
          </Label>
          <span>
            <Label>
              <p>rg</p>
              <Input
                type="number"
                onChange={this.handleChange}
                value={this.state.name}
                placeholder="000000-0"
              />
            </Label>
            <Label>
              <p>Orgão expedidor</p>
              <Input
                type="text"
                onChange={this.handleChange}
                value={this.state.name}
              />
            </Label>
          </span>
          <span>
            <Label>
              <p>uf</p>
              <Input
                type="text"
                onChange={this.handleChange}
                value={this.state.name}
              />
            </Label>
            <Label>
              <p>data de nascimento</p>
              <Input
                type="number"
                onChange={this.handleChange}
                value={this.state.name}
                placeholder="02/01/2020"
              />
            </Label>
          </span>
          <Label>
            <p>cpf</p>
            <Input
              type="number"
              onChange={this.handleChange}
              value={this.state.name}
              placeholder="000000-0"
            />
          </Label>
          <Label>
            <p>email</p>
            <Input
              type="email"
              onChange={this.handleChange}
              value={this.state.name}
            />
          </Label>
          <Label>
            <p>telefone</p>
            <Input
              type="tel"
              onChange={this.handleChange}
              value={this.state.name}
              placeholder="(00) 00000-0000"
            />
          </Label>
          <Label>
            <p>senha</p>
            <Input
              type="password"
              onChange={this.handleChange}
              value={this.state.name}
              placeholder="Inserir senha"
            />
          </Label>
          <p>
            Clique abaixo para concordar com os <p>Termos de Serviço</p> e
            registrar.
          </p>
        </Form>
      </Container>
    );
  }
}
